import React from "react";
//import { css } from '@emotion/react';
import styled from "@emotion/styled";
import myLogo from '../../resources/images/pagelogo.svg';
import myGroup from '../../resources/images/group.svg'; 

const Footer = styled.section`
  display: flex;
  background-color: #304F47;
  height: 530px;
  width: 100%;
  color: white;
  display: flex;
  z-index: 1;
  font-family: 'Mulish';
  position: relative;
`;

const Left = styled.div`
  flex-basis: 50%;
  padding: 10px;
`;
const Right = styled.div`
  padding: 10px;
`;

const LogoArea = styled.div`
  display: flex;
  gap: 50%;
`

const FooterEnd = styled.section`
  display: flex;
  background: #304F47;
  color: #fff;
  align-content: center;
  justify-content: center;
`

export default function footer() {
  return (
    <div>
    <Footer>
      <Left>
        <h1>Let you have any question, Let us help you!</h1>
        <div>
          <p>
            If you have any questions or would like to book a tour with us,
            please don't hesitate to contact us. <br/><br/>
            Phone: +250 788 123 456 <br />
            Email: info@rwandatourism.com <br />
            Address: Kigali, Rwandabr <br />           
            <br /><br /><br />
            <b>Subscribe to our news paper</b>
            </p>
            </div>
            <div>
              <form action="">
                <input type="text" />
                <button type="submit">Send</button>
              </form>
            </div>
            </Left>
            <Right>
              <LogoArea> 
                <img src={myLogo} alt="" srcset="" /> 
                <img src={myGroup} alt="" srcset="" />
              </LogoArea>
              <div><p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p></div>
              <div>
                <ul type="none">
                <li>Home</li>
                <li>Testimonials</li>
                <li>Destinations</li>
                <li>Sign In</li>
                <li>About Us</li>
                <li>Packages</li>
                <li>Events</li>
                <li>Gallery</li>
                </ul></div>
            </Right>
    </Footer>
    <FooterEnd>
    <div>Copyright Africa Wizzy Safari 2022</div><br />
    <div>Design implemented by <b>@clint360</b></div>
    </FooterEnd>
    </div>
  );
}
